import Menu from './asserts/menu'

function App() {
  return (
    <div className="User_Profile">
      <div className='profileBar'>
       <nav className='topBar'> 
          <Menu/>
          <div>Profile</div>
       </nav>
       </div>
    </div>
  );
}

export default App;
